import AircraftList from "../../components/aircraftList/AircraftList";
import Header from "../../components/header/Header";
import "./Hangar.css";

function Hangar() {
  return (
    <>
      <Header />
      <h1>Simplefly</h1>
      <AircraftList />
    </>
  );
}

export default Hangar;
